import './card-profile.module.scss'

function CardProfile({
  name, // имя
  hashtags, // информация о коте
  feature, // особенность (ласковый, новенький и т.д.) CatFeature
  image // url c фото кота
}) {
  return (
    <article className="card-profile">
      <figure className="card-profile__figure">
        <img
          src={image}
          className="card-profile__image"
          width={313}
          height={320}
          alt="Аватар."
        />
        <StarIcon className="star-card__icon" feature={feature} />
      </figure>
      <Title size={TitleSize.SMALL}>{name}</Title>
      <p
        className="star-card__text"
        dangerouslySetInnerHTML={{ __html: hashtags }}
      />
    </article>
  );
}

export default CardProfile;
